;define("pan-center:widget/components/helpContent/help-content.js",function(t,s,a){var n=t("base:thirdParty/san/san.js"),p=t("base:thirdParty/san/san-router.js"),l=(p.router,n.defineComponent({template:'<div class="help-content">\n    <template s-if="contentId === 0">\n        <p class="txt">百度网盘会员类型分为会员和超级会员，不同会员类型尊享不同功能特权：</p>\n        <p class="txt" style="text-align: center;margin: 20px 0 20px;">百度网盘会员功能特权对比</p>\n        <ul class="contrast-box" style="width: 312px;">\n            <li class="contrast-item-title">功能特权</li>\n            <li class="contrast-item">文件转存</li>\n            <li class="contrast-item-d">网盘客户端批量上传</li>\n            <li class="contrast-item">网盘PC客户端自动备份</li>\n            <li class="contrast-item-d">手机视频备份</li>\n            <li class="contrast-item">本地文件夹备份（安卓）</li>\n            <li class="contrast-item-d">存储空间</li>\n            <li class="contrast-item">文件下载速度</li>\n            <li class="contrast-item-d">云解压</li>\n            <li class="contrast-item">视频高速通道</li>\n            <li class="contrast-item-d">垃圾文件清理</li>\n            <li class="contrast-item">大文件上传（网盘客户端）</li>\n            <li class="contrast-item-d">回收站有效期</li>\n            <li class="contrast-item">全文检索</li>\n            <li class="contrast-item-d">身份标识</li>\n        </ul>\n        <ul class="contrast-box" style="width: 136px;">\n            <li class="contrast-item-title">非会员</li>\n            <li class="contrast-item">1000</li>\n            <li class="contrast-item-d">500</li>\n            <li class="contrast-item">不支持</li>\n            <li class="contrast-item-d">不支持</li>\n            <li class="contrast-item">不支持</li>\n            <li class="contrast-item-d">无额外空间</li>\n            <li class="contrast-item">普通下载</li>\n            <li class="contrast-item-d">不支持</li>\n            <li class="contrast-item">不支持</li>\n            <li class="contrast-item-d">不支持</li>\n            <li class="contrast-item">4G</li>\n            <li class="contrast-item-d">10天</li>\n            <li class="contrast-item">不支持</li>\n            <li class="contrast-item-d">无</li>\n        </ul>\n        <ul class="contrast-box" style="width: 196px;">\n            <li class="contrast-item-title">会员</li>\n            <li class="contrast-item">3000</li>\n            <li class="contrast-item-d">500</li>\n            <li class="contrast-item">支持</li>\n            <li class="contrast-item-d">原视频备份</li>\n            <li class="contrast-item">支持</li>\n            <li class="contrast-item-d">免任务2T空间</li>\n            <li class="contrast-item">普通下载</li>\n            <li class="contrast-item-d">解压2G内压缩包</li>\n            <li class="contrast-item">不支持</li>\n            <li class="contrast-item-d">不支持</li>\n            <li class="contrast-item">10G</li>\n            <li class="contrast-item-d">15天</li>\n            <li class="contrast-item">年费用户专享</li>\n            <li class="contrast-item-d"><span class="user0"></span></li>\n        </ul>\n        <ul class="contrast-box" style="width: 196px;">\n            <li class="contrast-item-title">超级会员</li>\n            <li class="contrast-item">50000</li>\n            <li class="contrast-item-d">不限量</li>\n            <li class="contrast-item">支持</li>\n            <li class="contrast-item-d">原视频备份</li>\n            <li class="contrast-item">支持</li>\n            <li class="contrast-item-d">5T空间</li>\n            <li class="contrast-item">极速下载</li>\n            <li class="contrast-item-d">解压8G内压缩包</li>\n            <li class="contrast-item">支持</li>\n            <li class="contrast-item-d">支持</li>\n            <li class="contrast-item">20G</li>\n            <li class="contrast-item-d">30天</li>\n            <li class="contrast-item">年费用户专享</li>\n            <li class="contrast-item-d"><span class="user1"></span></li>\n        </ul>\n\n    </template>\n\n    <template s-elif="contentId === 1">\n        <p class="txt paragraph">\n            进入百度网盘\n            <a href="//yun.baidu.com/buy/center?tag=1" class="help-txt-btn">会员中心</a>\n            ，可以选择开通百度网盘会员。</p>\n        <p class="tit">开通方式</p>\n        <p class="txt">可以通过百度钱包、支付宝、微信支付、网银等多种方式购买开通。</p>\n        <p class="txt">步骤一：进入会员中心，使用你的百度帐号进行登录，还没有百度帐号，请从<a href="https://passport.baidu.com/v2/?reg&u=https%3A%2F%2Fpan.baidu.com%C2%AEType=1&tpl=netdisk" class="help-txt-btn">这里注册</a>；</p>\n        <p class="txt">步骤二：登录成功后，页面将显示你的用户名及会员开通状态，如果未开通，选择开通时长，付款方式；</p>\n        <p class="txt paragraph">(请根据页面提示选择你想要的服务，付费模式和服务时长)，进行支付即可。开通成功后，你马上可以享受尊贵的VIP服务了。</p>\n        <p class="tit">百度网盘会员过期时间如何计算？</p>\n        <p class="txt">百度网盘的会员有效期以自然月、年计算。</p>\n        <p class="txt">一个月的有效期是按自然月计算，如果该日期在下一月不存在，则将下一月的最后一天视为到期日，例如：</p>\n        <p class="txt">1、您于2017-1-12购买了一个月有效的套餐，则可使用至2017-2-12 23:59:59；</p>\n        <p class="txt">2、您于2017-1-30购买了一个月有效的套餐，则可使用至2017-2-28 23:59:59。</p>\n        <p class="txt">一年的有效期是按自然年计算，如果该日期在下一年不存在，则将下一年该月的最后一天视为到期日，例如：</p>\n        <p class="txt">1、您于2017-1-12购买了一年有效的套餐，则可使用至2018-1-12 23:59:59；</p>\n        <p class="txt paragraph">2、您于2016-2-29购买了一年有效的套餐，则可使用至2017-2-28 23:59:59。</p>\n        <p class="tit">支付成功后多长时间会成功开通百度网盘会员？</p>\n        <p class="txt paragraph">正常情况下，您只要通过在线充值缴费开通会员成功后，系统将立即会为您开通服务，中间可能会有2～3秒的延迟，但不影响您的正常使用。您可以在付费后刷新页面或重新登录，便可以查看你的百度网盘会员是否已经顺利开通。</p>\n        <p class="tit">百度网盘会员到期与续费方法</p>\n        <p class="txt">月付百度网盘会员的有效期按照自然月计算，年付百度网盘会员按照自然年计算，续费将百度网盘会员有效期按自然月、自然年顺延。</p>\n        <p class="txt">例如：您在2017-06-15日购买了一个月百度网盘会员，即在2017-07-15日到期。</p>\n        <p class="txt">1、如续费一月则可使用至2017-08-15 23:59:59。</p>\n        <p class="txt">2、如续费一年则可使用至2018-07-15 23:59:59。</p>\n    </template>\n\n    <template s-elif="contentId === 2">\n        <p class="txt paragraph">进入百度网盘<a href="//yun.baidu.com/buy/center?tag=8" class="help-txt-btn">超级会员中心</a>，可以选择开通百度网盘超级会员。</p>\n        <p class="tit">开通方式</p>\n        <p class="txt">可以通过百度钱包、支付宝、微信支付、网银等多种方式购买开通。</p>\n        <p class="txt">步骤一：进入超级会员中心，使用你的百度帐号进行登录，还没有百度帐号，请从<a href="https://passport.baidu.com/v2/?reg&u=http%3A%2F%2Fpan.baidu.com%C2%AEType=1&tpl=netdisk" class="help-txt-btn">这里注册</a>；</p>\n        <p class="txt">步骤二：登录成功后，页面将显示你的用户名及超级会员开通状态，如果未开通，选择开通时长，付款方式；</p>\n        <p class="txt paragraph">(请根据页面提示选择你想要的服务付费模式和服务时长)，进行支付即可。开通成功后，你马上可以享受尊贵的超级会员服务了。</p>\n        <p class="tit">百度网盘超级会员过期时间如何计算？</p>\n        <p class="txt">百度网盘的超级会员有效期以自然月、年计算。</p>\n        <p class="txt">一个月的有效期是按自然月计算，如果该日期在下一月不存在，则将下一月的最后一天视为到期日，例如：</p>\n        <p class="txt">1、您于2017-1-12购买了一个月有效的套餐，则可使用至2017-2-12 23:59:59；</p>\n        <p class="txt">2、您于2017-1-30购买了一个月有效的套餐，则可使用至2017-2-28 23:59:59。</p>\n        <p class="txt">一年的有效期是按自然年计算，如果该日期在下一年不存在，则将下一年该月的最后一天视为到期日，例如：</p>\n        <p class="txt">1、您于2017-1-12购买了一年有效的套餐，则可使用至2018-1-12 23:59:59；</p>\n        <p class="txt">2、您于2016-2-29购买了一年有效的套餐，则可使用至2017-2-28 23:59:59。</p>\n        <p class="txt">若同时购买会员和超级会员两种套餐，则优先提供超级会员特权，超级会员有效期结束后，顺延之前购买的会员套餐。</p>\n        <p class="txt paragraph">例如：您于2017-1-12购买了一个月有效的超级会员套餐，再次购买了三个月有效的会员套餐，则可使用超级会员至2017-2-12 23:59:59，可使用会员至2017-2-13 零点至2017-5-13 23:59:59。</p>\n        <p class="tit">支付成功后多长时间会成功开通百度网盘超级会员？</p>\n        <p class="txt paragraph">正常情况下，您只要通过在线充值缴费开通超级会员成功后，系统将立即会为您开通服务，中间可能会有2～3秒的延迟，但不影响您的正常使用。您可以在付费后刷新页面或重新登录，便可以查看你的百度网盘超级会员是否已经顺利开通。</p>\n        <p class="tit">百度网盘超级会员到期与续费方法</p>\n        <p class="txt">月付百度网盘超级会员的有效期按照自然月计算，年付百度网盘超级会员按照自然年计算，续费将百度网盘超级会员有效期按自然月、自然年顺延。</p>\n        <p class="txt">例如您在2017-06-15日购买了一个月百度网盘超级会员，即在2017-07-15日到期。</p>\n        <p class="txt">1、如续费一月超级会员则可使用至2017-08-15 23:59:59。</p>\n        <p class="txt">2、如续费一年超级会员则可使用至2018-07-15 23:59:59。</p>\n    </template>\n\n    <template s-elif="contentId === 3">\n        <P class="tit">我现在是会员，怎么成为超级会员？</P>\n        <P class="txt">答：补差价升级为超级会员的条件：当已购买会员服务多于整月时，补齐差价即可升级。</P>\n        <P class="txt">1）如果您当前的会员有效期剩余X个月Y天，则可以在购买超级会员时，抵扣X*10元。（可补齐月数≤X）；补齐后超级会员立即生效，超级会员到期后继续享受剩余会员服务。</P>\n        <P class="txt">例如：当前的会员有效期为3个月20天，您可以选择升级为3个月超级会员，抵扣3*10元=30元。升级后超级会员有效期是即刻起3个月有效，超级会员到期后继续享受20天的会员服务；</P>\n        <P class="txt">2）如果用户的会员不足1个月，则不适用于补齐规则，无法抵扣，只能直接开通超级会员；</P>\n        <P class="txt paragraph">例如：当前的会员有效期为20天，您购买1个月超级会员，不会出现抵扣价，按当前超级会员一个月的实际价格进行购买。超级会员有效期是即刻起1个月有效，超级会员到期后继续享受20天的会员服务；</P>\n        <P class="tit">我购买了“内容特权+会员”产品，怎么成为超级会员？</P>\n        <P class="txt">答：补差价升级为超级会员的条件：当已购买“内容特权+会员”服务多于整月时，补齐差价即可升级。</P>\n        <P class="txt">1）如果您当前的“内容特权+会员”有效期剩余X个月Y天，则可以在购买超级会员时，抵扣X*10元。（可补齐月数≤X）；补齐后超级会员立即生效，超级会员到期后继续享受剩余会员服务。此时会将您内容特权时长进行保留，超级会员到期后进行消耗使用。</P>\n        <P class="txt">例如：当前的“内容特权+会员”有效期为3个月20天，您可以选择升级为3个月超级会员，抵扣3*10元=30元。升级后超级会员有效期是即刻起3个月有效，超级会员到期后继续享受20天的“内容特权+会员”服务。</P>\n        <P class="txt">2）如果用户的“内容特权+会员”不足1个月，则不适用于补齐规则，无法抵扣，只能直接开通超级会员；</P>\n        <P class="txt paragraph">例如：当前的“内容特权+会员”有效期为20天，您购买1个月超级会员，不会出现抵扣价，按当前超级会员一个月的实际价格进行购买。超级会员有效期是即刻起1个月有效，超级会员到期后继续享受20天的“内容特权+会员”服务；</P>\n        <P class="tit">我现在是年费会员，可否只升级1个月的超级会员？</P>\n        <P class="txt paragraph">答：可以。升级时，补充1个月差价即可。超级会员到期后，继续享受原来未到期的会员服务。</P>\n        <P class="tit">我是iPhone用户，可以补差价升级超级会员吗？</P>\n        <P class="txt">答：因为 App Store 规则限制，无法进行补差价升级。iPhone用户，可以直接购买超级会员，原有会员有效期顺延。当超级会员到期后，可继续享受原来未到期的会员服务。</P>\n    </template>\n\n    <template s-elif="contentId === 4">\n        <p class="tit">付费容量的有效期如何计算？</p>\n        <p class="txt">您成功购买容量套餐之后，可以立即获得一年该容量套餐的使用权。</p>\n        <p class="txt">一年的有效期是按自然年计算，如果该日期在下一年不存在，则将下一年该月的最后一天视为到期日。</p>\n        <p class="txt">例如：</p>\n        <p class="txt">1、您于2017-1-12购买了一年有效的套餐，则可使用至2018-1-12 23:59:59；</p>\n        <p class="txt">2、您于2016-2-29购买了一年有效的套餐，则可使用至2017-2-28 23:59:59；</p>\n    </template>\n\n    <template s-elif="contentId === 5">\n        <p class="tit">容量到期后怎么处理？</p>\n        <p class="txt">您付费购买的容量到期后，可以自由选择是否续费。如果不续费，将收回到期的付费容量。容量回收后有两种情况：</p>\n        <p class="txt">1、实际存储文件容量小于免费获得的容量，您的功能不受任何影响；</p>\n        <p class="txt">2、实际存储文件容量等于或大于免费容量，我们不会删除文件，暂停您的上传，保存、离线下载等写入功能，其他功能可以正常使用。</p>\n        <p class="txt">对已经保存在百度网盘的数据，我们会竭力保证数据的安全以及用户的正常使用。对于容量的售价，我们在正常的容量套餐以及会员套餐之外，还会不定期推出各种特惠活动，发放各种优惠券等。请多关注百度网盘。</p>\n    </template>\n\n    <template s-elif="contentId === 6">\n        <p class="tit">我购买套餐成功了，但没有给我加容量怎么办？</p>\n        <p class="txt">服务器需要几分钟时间进行容量分配，请您稍候5分钟，刷新百度网盘界面，再次检查容量是否已增加。</p>\n        <p class="txt">如果仍不能增加成功，请将问题和您的帐号反馈给我们，点击<a href="http://qingting.baidu.com/index?pid=19" class="help-txt-btn">此处</a>反馈。</p>\n        <p class="txt">其他关于购买容量套餐的问题，可以直接反馈给我们，点击<a href="http://qingting.baidu.com/index?pid=19" class="help-txt-btn">此处</a>反馈。</p>\n    </template>\n\n    <template s-elif="contentId === 7">\n        <p class="tit">照片冲印服务是百度网盘提供的吗？</p>\n        <p class="txt">百度云冲印产品是由公众冲印网提供技术服务支持，卓越的品质保证。</p>\n    </template>\n\n    <template s-elif="contentId === 8">\n        <p class="tit">冲印照片质量不满意怎么办？</p>\n        <p class="txt">照片质量问题请拨打客服热线400 6578 999，或点击网站在线客服在线客服\n            <img title="在线客服" \n            alt="在线客服"\n            style="vertical-align: middle;cursor: pointer"\n            onclick="javascript:window.open(\'http://b.qq.com/webc.htm?new=0&amp;sid=800006519&amp;eid=2188z8p8p8p8p8x8R8q80&amp;o=cloud.pptake.com&amp;q=7&amp;ref=http://cloud.pptake.com/index?#\', \'_blank\', \'height=544, width=644,toolbar=no,scrollbars=no,menubar=no,status=no\');"\n            src=\'https://wangpan.bdstatic.com/n/box-static/pan-center-cdn/widget/components/helpContent/images/qq_cc7c95a.png\'\n        >\n        ，产品质量问题免费重印。</p>\n    </template>\n\n    <template s-elif="contentId === 9">\n        <p class="tit">照片规格小常识</p>\n        <p class="txt">由于传统照相技术以及现在流行的数码照相技术都是由国外引入我国，高端冲印设备也都是由国外进口的，国内在相片尺寸上一直沿用国际通用的几种度量方式。</p>\n        <p class="txt">“英寸”：照片所说的“几英寸”是指照片长的一边的英寸长度。比如6英寸照片，就是指规格为6×4英寸的照片。（1英寸等于2.54厘米） “R”：国际上还有一种通行的表示照片尺寸的方法，即取照片短的一边的英寸整数数值，加字母R来表示。</p>\n        <p class="txt">例如：5英寸照片，规格为5×3.5英寸，即3R。</p>\n        <p class="txt">“D”：现在大部分数码相机的拍摄影像长宽比例都是4:3，往往与各尺寸标准相片的长宽比例不符，这样在冲印过程中往往需要对画面进行少量剪裁或对相片留白处理。为了能做到全景冲印，现在有一种长宽比例为4:3规格的相片。表示方法是取相片的短边数值，加字母 D 来表示。</p>\n        <p class="txt paragraph">例如：全景6寸照片(即4D照片)，规格为6×4.5英寸；全景5寸照片(即3D照片)，规格为5×3.75英寸。</p>\n        <p class="tit">常见的冲印尺寸</p>\n        <p class="txt paragraph">6英寸和全景6寸是现在国际流行尺寸。能满足大家对大画面的需求。我们提供6英寸—36英寸全尺寸冲印服务。</p>\n        <p class="tit">合影适合的尺寸</p>\n        <p class="txt paragraph">如果拍摄画面为普通方形片，可以正常选择冲印尺寸；如拍摄画面为细长形，我们专门提供长条片尺寸，如6*12、6*18英寸等特殊尺寸，满足您大合影的需求。</p> \n        <p class="tit">寸与英寸的区别</p>\n        <p class="txt paragraph">英寸是英式的长度单位，照片所说的“几英寸”是指照片长的一边的英寸长度。比如6英寸照片，就是指规格为6×4英寸的照片。寸是中国的长度单位，1英寸 = 2.54 厘米</p>\n        <p class="tit">6英寸与全景6寸的区别</p>\n        <p class="txt paragraph">2种尺寸长度相同为15.2厘米，6寸全景较宽宽度为11.4厘米，6英寸宽度为10.2厘米。对于民用相机来说照片比例为4:3适合冲印6寸全景照片，如冲印6英寸会被裁切掉11.4-10.2=1.2厘米画面。（如图天空部分）</p>\n        <div class="picture1"></div>\n        <p class="tit">我的照片适合冲印什么尺寸</p>\n        <p class="txt">（1）一般民用相机拍摄的照片比例为4:3，适合冲印全景6寸，可以保证画面完整性不裁切；单反相机拍摄的照片比例一般为2:3，正好与6英寸吻合。除风景片外不建议采用16:9的比例进行拍摄，裁切比较大，注意调整您的拍摄器材哦。友情提示：桌子、案头摆放照片适合冲印8-12英寸。</p>\n        <p class="tit">富士相纸与柯达相纸的区别</p>\n        <p class="txt paragraph">富士相纸全能型相纸，性价比高，色彩还原一流符合亚洲人审美。尤其在风景表达上比较突出。柯达金樽相纸被柯达归入专业相纸类别，柯达金樽相纸色彩还原真实、影像逼真，纸基比普通相纸厚20%手感最佳，对暖色调表现突出。</p>\n        <div class="picture2"></div>\n        <p class="tit">相纸光面和绒面的区别</p>\n        <p class="txt paragraph">光面相纸表面光滑，亮度比较亮，清晰度好，对外景照片表现真实。绒面相纸表面有磨砂感，为压光效果，亮度没有光面相纸高，但是不容易留指纹。光面与绒面并无好坏之分，评个人喜好而定。</p>\n        <div class="picture3"></div>\n    </template>\n\n    <template s-elif="contentId === 10">\n        <p class="tit">裁切与留白？</p>\n        <p class="txt paragraph">照片冲印默认裁切效果，对个别无法裁切的照片进行留白边处理。自拍照与大头照画面较满尤其注意裁切问题。</p>\n        <div class="picture4"></div>\n        <p class="tit">照片文件偏色可以还原吗？</p>\n        <p class="txt paragraph">照片偏色是在呈像过程中受各种条件所致，在冲印过程中无法做到全部还原真实色彩，尽量做到最佳调整，偏色照片请慎重选择。</p>\n        <p class="tit">为什么冲印后颜色与屏幕不同？</p>\n        <p class="txt paragraph">由于计算机屏幕显色是采用RGB色彩模式（红、绿、蓝），而印刷采用的标准是CMYK色彩模式。RGB模式比CMYK模式拥有更多的色值和色彩表现度，所以印刷品往往都与计算机屏幕显示的颜色略有差异。另外，任何两台显示器也会由于设置和性能的原因，出现色彩显示差异。这些都是不可避免的，但是我们依然能保证我们服务能提供行业内最好色彩还原技术，所以您尽可放心。</p>\n        <p class="tit">购物车中的照片没有了？</p>\n        <p class="txt">购物车中的照片没有了，有以下三种可能：</p>\n        <p class="txt">（1）客户在未登录状态上传到购物车的相片网站无法保存。</p>\n        <p class="txt">（2）我们定期会对购物车清理，连续一周不完成订制的购物车中的信息将被系统自动删除。</p>\n        <p class="txt">（3）您的帐号被别人盗用，用您的名义登录本站，删除了您的照片。</p>\n    </template>\n\n    <template s-elif="contentId === 11">\n        <p class="tit">冲印价格、尺寸及材质</p>\n        <div class="picture5"></div>\n    </template>\n\n    <template s-elif="contentId === 12">\n        <p class="tit">配送范围到哪里？运费如何计算？</p>\n        <div class="picture6"></div>\n    </template>\n\n    <template s-elif="contentId === 13">\n        <p class="tit">退换货保证</p>\n        <p class="txt paragraph">本网站秉承“客户为先，诚信至上”的宗旨，为广大客户提供最优质的商品及服务。我们承诺我们所销售的商品均是全新品，能够提供正规的售后保障。我们保证商品的正规进货渠道和质量，如果您对购买的商品质量表示怀疑，我们会按照国家法律规定予以处理。但对于任何欺诈性行为，本网站将保留依法追究法律责任的权利。本规则由本站根据国家相关法律法规及规章制度予以解释。</p>\n        <p class="tit">售后服务承诺</p>\n        <div class="picture7"></div>\n        <p class="tit">退换货总则</p>\n        <p class="txt paragraph">郑重承诺：本网站所售均为全新品！符合以下情况，由产品售出之日（以实际收货日期为准）起7日内可以退换 货，15日内可以换货（不含客户个人原因），客户可在线与客服中心联系咨询、办理退换货事宜。具体退换货标准如下：</p>\n        <p class="tit">特别说明：</p>\n        <p class="txt">1.判断实际收货日期规则：</p>\n        <p class="txt">1)客户自提的订单：以客户实际签收日期为准；</p>\n        <p class="txt">2)非本网站配送的订单，按照第三方物流平台显示的实际到货日期为准。</p>\n        <p class="txt">2.以下情况不予办理退换货：</p>\n        <p class="txt">1)任何非本网站出售的商品（序列号不符）；</p>\n        <p class="txt">2)过保商品（超过三包保修期的商品）</p>\n        <p class="txt">3)未经授权的维修、误用、碰撞、疏忽、滥用、进液、事故、改动、不正确的安装所造成的商品质量问题，或撕毁、涂改标贴、机器序号、防伪标记；</p>\n        <p class="txt">4)商品的外包装、附件、赠品（券）（需要和主商品一起退换）、说明书不完整，（券）发票缺失或涂改；</p>\n        <p class="txt">5)密封产品原包装打开，一次性封贴或胶条破损（质量问题除外）；</p>\n        <p class="txt">6)产品已使用（质量问题除外）；</p>\n        <p class="txt">7)礼品卡退货时金额退回卡内，不予兑现；</p>\n        <p class="txt">8)图片及信息仅供参考，不属质量问题。因拍摄灯光及不同显示器色差等问题可能造成商品图片与实物有色差，一切以实物为准；</p>\n        <p class="txt">9)其他依法不应办理退换货的。/p>\n        <p class="txt" style="color: #fd6d65;">温馨提示：在商品退换货时，需扣除购买该商品时通过评价或晒单所获得的积分及相应优惠，如账户积分已使用，则从商品退款金额中相应扣除。</p>\n    </template>\n\n    <template s-elif="contentId === 14">\n        <p class="tit">忘记索要发票了，如何补开？</p>\n        <p class="txt paragraph">如果您在提交订单时没有索取发票，公众冲印网可以为您提供补开发票的服务，请务必于下单后一个月内通过在线客服（工作日8:30-17:30）和我们联系，请您提供您的订单号、发票抬头、寄送地址、邮编及收件人姓名给我们，我们会在补开发票后为您快递寄出（运费自行承担），若超过一个月将不再提供补寄服务。如果您是在提交订单时索取发票后而没有收到发票，我们将会免邮费为您补寄发票。</p>\n        <p class="tit">发票内容有误怎么办？</p>\n        <p class="txt">如果您在收到发票后，发现发票抬头或金额与您提交订单时所填写的项目不符，您可以与我们在线客服联系，提供您的订单号、正确发票抬头、寄送地址、邮编及收件人姓名，我们会在会重新开取发票为您寄出。</p>\n        <p class="txt">如果是由于您自己原因导致发票开错，您需补税点及补寄的邮费，具体方式请先咨询我们的客服人员。</p>\n    </template>\n\n    <template s-elif="contentId === 20">\n        <p class="tit">所需支付金额超过了银行支付限额？</p>\n        <p class="txt paragraph">您可以到银行柜台或登录网上银行提高上限额度，即能轻松支付。</p>\n        <p class="tit">支付宝或网银页面显示错误或者空白</p>\n        <p class="txt paragraph">有些网银对浏览器兼容性有一定要求，导致无法正常支付，若因浏览器造成支付失败，建议您使用IE浏览器进行支付操作。</p>\n        <p class="tit">网上银行已扣款，订单仍显示“未付款”</p>\n        <p class="txt paragraph">可能由于银行的数据传输有滞后性，请不要担心，稍后刷新页面查看。如较长时间仍显示未付款，可前往<a href="http://qingting.baidu.com/index?pid=19" class="help-txt-btn">http://qingting.baidu.com/index?pid=19</a>反馈问题。</p>\n        <p class="tit">没有网上银行如何购买？</p>\n        <p class="txt paragraph">支付宝的快捷支付中，有几家银行不需要您开通网银，如果您有工商银行、农业银行、交通银行的储蓄卡，可以直接使用“快捷支付”。</p>\n        <p class="tit">没找到我常用的网上银行？</p>\n        <p class="txt paragraph">对于主流的网上银行支付，百度网盘都是支持的，但对于部分省市级银行如"江苏银行"、"大连银行"还不支持，您可以选择"支付宝"或"微信支付"选择对应银行完成支付。</p>\n        <p class="tit">是否支持信用卡支付？</p>\n        <p class="txt paragraph">百度网盘支持多数银行的信用卡网上支付功能，如暂不支持您的银行信用卡，建议您通过"支付宝"或"微信支付"选择对应银行完成支付。</p>\n        <p class="tit">网银扣款后订单仍显示"未付款"？</p>\n        <p class="txt paragraph">可能是由于银行的数据没有即时传输，请您不要担心，稍后刷新页面查看。如较长时间仍显示未付款，可前往<a href="http://qingting.baidu.com/index?pid=19" class="help-txt-btn">http://qingting.baidu.com/index?pid=19</a>反馈问题。</p>\n        <p class="tit">网上银行支付失败怎么办？？</p>\n        <p class="txt paragraph">如有由于网络中断，或页面过期、超时、错误等问题导致支付失败，请先确认是否已经扣款，如未扣款可尝试再支付一次。或者，您可以联系您的银行或支付平台获得帮助。</p>\n    </template>\n\n    <template s-elif="contentId === 21">\n        <p class="tit">百度网盘激活码如何使用？</p>\n        <p class="txt paragraph">百度网盘激活码是百度网盘会员服务激活的兑换的码，目前在特定渠道发送，拥有后可为任何帐号激活充值百度网盘会员服务。\n                登录百度网盘帐号后，点击<a href="http://yun.baidu.com/buy/card" class="help-txt-btn">http://yun.baidu.com/buy/card</a>，输入激活码进行激活即可。</p>\n        <div class="picture12_2"></div>\n    </template>\n    <template s-elif="contentId === 22">\n        <p class="tit">1.开具增值税普通发票：</p>\n        <p class="txt paragraph">从2018年8月23日起，针对会员类、超级会员类及容量套餐类产品，百度网盘支持在线开具增值税普通发票电子版（简称：电子发票），该日期之前的订单只能申请开增值税普通发票纸质版。</p>\n        <p class="txt paragraph">增值税普通发票电子版开票方法：请前往<a href="/buy/center?tag=3&from=non#/personalcenter/6" class="help-txt-btn">“百度网盘会员中心-个人中心-消费记录-我的发票”</a>开发票。开票成功后，即可下载电子发票。\n            增值税普通发票纸质版开票方法：请前往<a href="http://help.baidu.com/newadd?prod_id=29&category=3" class="help-txt-btn">“百度服务中心-百度网盘”</a>开发票。</p>\n        <p class="tit">2.开具增值税专用发票（仅支持纸质版）：</p>\n        <p class="txt paragraph">增值税专用发票纸质版开票方法：请前往<a href="http://help.baidu.com/newadd?prod_id=29&category=3" class="help-txt-btn">“百度服务中心-百度网盘”</a>开发票。</p>\n        <p class="tit">3.针对云冲印产品的开具发票：</p>\n        <p class="txt paragraph">对于云冲印产品的订单，请于工作日内的8:30-17:30联系云冲印的客服开具发票，客服电话：4006578999（免长途费）， 客服QQ：800006519</p>\n\n    </template>\n</div>'}));a.exports=l});
